    <style>.cf_challenge_text_small {
    font-size: 11px;
}

body {
    height: 100vh;
    width: 100vw;
    overflow-x: hidden;
    font-family: sans-serif;
    font-weight: 400;
    font-size: 14px;
    line-height: 20px;
    letter-spacing: 0.2px;
    color: rgba(255, 255, 255, 0.5);
    margin: 0;
    background: #101014;

    display: flex;
    flex-direction: column;
    justify-content: center;
    align-items: center;
}

.logo {
    display: flex;
    align-items: center;
    flex-direction: column;
    text-align: center;
    padding-bottom: 25px;
}

section {
    display: flex;
    align-items: center;
    flex-direction: column;
    text-align: center;
}

h1, p {
    font-family: Brutal, sans-serif;
    padding: 0;
    margin: 0;
}

h1 {
    line-height: 34px;
    text-align: center;
    letter-spacing: -0.5px;
    color: #fff;
    margin: 0 0 20px;
    font-size: 30px;
    font-weight: 600;
}

p {
    font-size: 14px;
    line-height: 20px;
    letter-spacing: 0.2px;
    color: rgba(255, 255, 255, 0.5);
}

a {
    color: #61CDFF;
}

a:visited {
    color: white;
}

strong {
    font-weight: 400;
    color: #fff;
}

.cf_challenge_container {
    max-width: 430px;
    min-width: 200px;
    background-color: #202024;
    display: flex;
    justify-content: center;
    flex-direction: column;
    font-family: sans-serif;
    line-height: initial;
    overflow: auto;
    border-radius: 16px;
    border: 1px solid rgba(255, 255, 255, 0.15);
    margin: 25px;
    padding: 25px;
    box-shadow: 0px 32px 16px 0 rgba(0, 0, 0, 0.1);
}

.cf_challenge {
    text-align: center;
    display: flex;
    justify-content: center;
    flex-direction: column;
    margin: 25px 0;
}

.cf_challenge_container hr {
    border-bottom: 0;
    max-width: 500px;
    opacity: 0.25;
}

.cf_close_button {
    background: rgba(0, 0, 0, 0);
    border-radius: 4px;
    color: #fff;
    cursor: pointer;
    padding: 5px;
    position: absolute;
    right: 15px;
    top: 10px;
    transition: .1s;
}

.cf_close_button:hover {
    background: #3b3b3b;
}

.cf_error_container button {
    background: rgba(0, 0, 0, 0);
    border: 1px solid #000;
    border-radius: 4px;
    color: #000;
    cursor: pointer;
    font-family: sans-serif;
    font-weight: 700;
    margin: 5px;
    padding: 14px 22px;
}

.cf_error_container p {
    color: #000;
    font-family: sans-serif;
    font-size: 14px;
    margin: 20px;
}

.cf_error_container {
    align-items: flex-start;
    background: #FFA640;
    border-radius: 4px;
    display: none;
    justify-content: space-between;
    margin: auto auto 8px;
    text-align: left;
    width: 500px;
}

.cf_logo {
    margin: 0 auto;
    width: 41px;
}

const getLocaleStrings = (locale = 'en') => {
    switch (locale.toLowerCase()) {
        case 'ar':
            return localeStrings.ar;
        case 'de-de':
        case 'de':
            return localeStrings.de;
        case 'en-us':
        case 'en':
            return localeStrings.en;
        case 'es-es':
            return localeStrings["es-ES"];
        case 'es-mx':
            return localeStrings["es-MX"];
        case 'fr':
        case 'fr-fr':
            return localeStrings.fr;
        case 'it':
        case 'it-it':
            return localeStrings.it;
        case 'ja':
        case 'ja-jp':
            return localeStrings.ja;
        case 'ko':
        case 'ko-kr':
            return localeStrings.ko;
        case 'pl':
            return localeStrings.pl;
        case 'pt':
        case 'pt-br':
            return localeStrings["pt-BR"];
        case 'ru':
        case 'ru-ru':
            return localeStrings.ru;
        case 'th':
            return localeStrings.th;
        case 'tr':
            return localeStrings.tr;
        case 'zh':
        case 'zh-cn':
            return localeStrings["zh-CN"];
        case 'zh-tw':
            return localeStrings["zh-TW"]
        default: {
            const hyphIndex = locale.indexOf('-');
            const localeSub = locale.substring(0, hyphIndex);
            if (hyphIndex > -1) {
                return getLocaleStrings(localeSub);
            } else {
                return localeStrings.en;
            }
        }
    }
}

document.addEventListener("DOMContentLoaded", function () {
    const els = document.querySelectorAll('[data-t]');
    els.forEach((el) => {
        const tKey = el.getAttribute('data-t');
        const locale = window.navigator.language;
        const loc = getLocaleStrings(locale);
        el.innerText = loc[tKey];
    })
});</script>
